template <std::size_t Size>
struct Configuration
{
    const std::array<std::array<unsigned, Size>, Size> data;
    const bool is_goal;
    const bool solvable;
    const unsigned hamming;
    const unsigned manhattan;
};

template <std::size_t Size>
std::ostream & operator << (std::ostream & strm, const Configuration<Size> & config)
{
    for (const auto & row : config.data) {
        strm << "\n\t";
        bool first = true;
        for (auto x : row) {
            if (!first) {
                strm << ' ';
            }
            else {
                first = false;
            }
            strm << std::setw(2) << x;
        }
    }
    return strm;
}

template <std::size_t Size>
constexpr std::size_t board_size(const Configuration<Size> &)
{
    return Size;
}

template <std::size_t Size>
Board make_board(const Configuration<Size> & config)
{
    std::vector<std::vector<unsigned>> data;
    data.reserve(Size);
    for (const auto & row : config.data) {
        data.emplace_back(row.begin(), row.end());
    }
    return Board{data};
}

