TEST(BoardTest, empty)
{
    Board b;
    EXPECT_EQ(0, b.size());
    EXPECT_TRUE(b.is_goal());
    EXPECT_EQ(0, b.hamming());
    EXPECT_EQ(0, b.manhattan());
    EXPECT_TRUE(b.is_solvable());
    {
        const auto copy = b;
        EXPECT_EQ(b, copy);
        EXPECT_EQ(0, copy.size());
        EXPECT_TRUE(copy.is_goal());
        EXPECT_EQ(0, copy.hamming());
        EXPECT_EQ(0, copy.manhattan());
        EXPECT_TRUE(copy.is_solvable());
    }

    Board bb(0), other(11);
    EXPECT_EQ(0, bb.size());
    EXPECT_TRUE(bb.is_goal());
    EXPECT_EQ(0, bb.hamming());
    EXPECT_EQ(0, bb.manhattan());
    EXPECT_TRUE(bb.is_solvable());
    other = bb;
    EXPECT_EQ(bb, other);
    EXPECT_EQ(0, other.size());
    EXPECT_TRUE(other.is_goal());
    EXPECT_EQ(0, other.hamming());
    EXPECT_EQ(0, other.manhattan());
    EXPECT_TRUE(other.is_solvable());
}

TEST(BoardTest, singleton)
{
    Board b(1);
    EXPECT_EQ(1, b.size());
    EXPECT_TRUE(b.is_goal());
    EXPECT_EQ(0, b.hamming());
    EXPECT_EQ(0, b.manhattan());
    EXPECT_TRUE(b.is_solvable());
    EXPECT_EQ(0, b[0][0]);
}

TEST(BoardTest, copy)
{
    Board b(3), bb = b;
    Board bbb(7);
    bbb = b;
    EXPECT_EQ(b, bb);
    EXPECT_EQ(bb, bbb);
    EXPECT_EQ(b.size(), bb.size());
    EXPECT_EQ(b.hamming(), bbb.hamming());
    EXPECT_EQ(b[1][1], bb[1][1]);
    EXPECT_EQ(b.is_solvable(), bbb.is_solvable());
}

TEST(BoardTest, random_create)
{
    for (unsigned i = 0; i < 111; ++i) {
        Board b(i);
        EXPECT_EQ(i, b.size());
        unsigned hamming = 0, expected = 0;
        const unsigned max = i > 0 ? i * i - 1 : 0;
        for (unsigned x = 0; x < i; ++x) {
            for (unsigned y = 0; y < i; ++y) {
                if (expected < max) {
                    ++expected;
                }
                else {
                    expected = 0;
                }
                if (b[x][y] != expected) {
                    ++hamming;
                }
            }
        }
        EXPECT_EQ(hamming, b.hamming()) << " for " << i;
        EXPECT_EQ(hamming == 0, b.is_goal()) << " for " << i;
    }
}

TEST(BoardTest, two)
{
    for (const auto & c : twos) {
        const auto b = make_board(c);
        EXPECT_EQ(board_size(c), b.size()) << "Wrong board size for" << c;
        EXPECT_EQ(c.is_goal, b.is_goal()) << "Wrong goal detection for" << c;
        EXPECT_EQ(c.solvable, b.is_solvable()) << "Wrong solvability detection for" << c;
        EXPECT_EQ(c.hamming, b.hamming()) << "Wrong hamming distance for " << c;
        EXPECT_EQ(c.manhattan, b.manhattan()) << "Wrong manhattan distance for" << c;
        Board other(7);
        other = b;
        EXPECT_EQ(b.size(), other.size());
        EXPECT_EQ(b.is_goal(), other.is_goal());
        EXPECT_EQ(b.is_solvable(), other.is_solvable());
        EXPECT_EQ(b.hamming(), other.hamming());
        EXPECT_EQ(b.manhattan(), other.manhattan());
    }
}

